import React from 'react';
import { Button } from 'antd';

function App() {
  return (
    <div className="contenedor container-fluid">
      <div className="row">
        <div className="col-6">
          <h1>Hola</h1>
        </div>
        <div className="col-6">
          <Button type="primary">Button</Button>
        </div>
      </div>
    </div>
  );
}

export default App;
